    return state.communitySlice.error;
  });
  return (
    <div>
      <p>
        {msg} | {status} | {err}
      </p>
      <button
        onClick={() => {
          dispatch(asyncCommunity());
        }}
      >
        abc
      </button>
    </div>
  );
}
